llm_output:
function showSupply() public view returns (uint256) {
    uint256 supply = _totalSupply;                 // Total minted tokens
    uint256 burned = _balances[address(0xdead)];   // Tokens held at burn address

    // Reproduce original SafeMath overflow check
    require(burned <= supply, "SafeMath: subtraction overflow");

    return supply - burned;                        // Circulating supply
}

ground_truth:
function showSupply() public view returns (uint256) {
        return _totalSupply.sub(balanceOf(DEAD)).sub(balanceOf(ZERO));
    }
